import React, { useEffect } from "react";
import CarouselComponent from "../components/CarouselComponent";
function Home(props) {
useEffect(() => {
props.setProgress(50);
setTimeout(() => {
    props.setProgress(100);
}, 500);
}, []);
return (
<>
    <section>
    <CarouselComponent />
    </section>

    <section>
    <h1 style={{color:"whitesmoke"}}>Some Content</h1>
    </section>

    <section>
    <h2>Available for</h2>
    </section>
</>
);
}

export default Home;
